DROP TABLE precomputeMatrix;
CREATE TABLE precomputeMatrix (start_block int NOT NULL, source_lat char(20), source_long char(20), end_block int DEFAULT '0' NOT NULL, dest_lat char(20), dest_long char(20), distance int, time int, PRIMARY KEY (start_block, end_block), INDEX idx1_precomputeMatrix (source_lat, source_long), INDEX idx2_precomputeMatrix (dest_lat, dest_long)) ENGINE=InnoDB DEFAULT CHARSET=latin1;
